hbar_omega = 1.05457e-34*2.415e15


def splittedNAmW(CapitalOmega,CapitalDelta,Pin_mW,Eta,CapitalOmegam,CapitalGammam,scale,Gamma,g0,Kappa):
    sqrtKappaex=sqrt(Kappa*Eta)
    Gammahalf=Gamma/2
    e2=(16*(Gammahalf**2-CapitalDelta**2)**2+8*(Gammahalf**2+CapitalDelta**2)*Kappa**2+Kappa**4)
    Chiopt=(-1j*(CapitalOmega+CapitalDelta)+Kappa/2)
    Chi=CapitalOmegam**2-CapitalOmega**2-1j*CapitalOmega*CapitalGammam
    
    Kappaex = Kappa*Eta
    
    
    s = Pin_mW/(1000*hbar_omega)*(Kappaex/(CapitalDelta**2+Kappa**2/4))
    
    
    val = (sqrtKappaex**2*(1j*e2*Chi*Chiopt+32*g0**2*s**2*sqrtKappaex**2*Gammahalf**2*CapitalOmegam))/(1j*e2*Chi*(Gammahalf**2+Chiopt**2)+8*g0**2*s**2*sqrtKappaex**2*((4*CapitalDelta**2+Kappa**2)*Chiopt+4*Gammahalf**2*(1j*Kappa+Chiopt))*CapitalOmegam)

    return numpy.real(scale*val*numpy.conjugate(val))


